INSERT INTO `news_events` VALUES ('1', 'Serbisyong Sta. Cruz', 'Magandang umaga po sa ating mga Kabarangay lalo na po sa Sitio Lucas at 7hills Ang Inyong Lingkod Kapitan Cirilo \" Bebot\" Tenorio kasama ang ating Masisipag na Sangguniang Barangay at sa pakikipagtulungan ng Sangguniang Kabataan at Youth Federation ng Barangay Sta.Cruz  meron po tayong Serbisyong Barangay Sta.Cruz bukas March 4, 2023 / 7AM gaganapin sa Lucas Compound and 7 hills. \r\nSee you po mga Kabarangay !\r\nMakakasama po natin bukas ang Inyong mga Lingkod Barangay sa gaganapin na Serbisyong Barangay sa inyong Sitio!', 'News_20230531022604.jpg', 'Free Vitamins', '2023-03-03', '09:00:00', 'upcomming', 'Oscar Sese', 'Sta. Cruz Admin', 'Sitio Igiban', '2023-04-01 09:00:00', '2023-05-31 08:26:04', '0');
INSERT INTO `news_events` VALUES ('4', 'Sports League 2023', 'PARA SA MGA MANLALARONG KABATAAN NG BARANGAY STA. CRUZ KAYO AY AMING INAANYAYAHAN \r\nMaari na kayong magpasa ng inyong  mga Line-up para po sa ating Basketball and Volleyball Teams para sa SK STA CRUZ SPORTS LEAGUE 2023\r\nMay 30, 2023\r\n10:00 am to 5:00 pm\r\nNew Bldg. Brgy. Sta. Cruz\r\nAng team ay per sitio na po at binubuo 12 na manlalaro.\r\nSa mga katanungan maaari po kayong mag chat sa aming Facebook Page.\r\nSK Sta. Cruz Sports League 2023\r\nProject of SK Chairwoman MARIANE KATE T. CABILES and SK Council\r\nIn coordination with Brgy. Capt. Hon. Cirilo \"Bebot\" Tenorio.', 'News_20230531022210.jpg', 'Sports', '2023-05-30', '08:00:00', 'one month', 'Oscar Sese', 'Sta. Cruz Admin', 'Sitio Igiban', '2023-04-01 14:00:00', '2023-05-31 08:22:10', '1');
INSERT INTO `news_events` VALUES ('6', 'New Events', 'Join us', 'News_20230527001325.jpg', 'events', '2023-06-01', '10:00:00', 'ra', 're', 'ra', 'Barangay Health Center', '2023-04-02 09:00:00', '2023-05-27 06:13:25', '1');
INSERT INTO `news_events` VALUES ('10', 'Mass Anti - Rabies Vaccination ', 'Ang inyong Lingkod Kap.Cirilo \"Bebot\"Tenorio at Sangguniang Barangay ay taos pusong nag papasalamat sa sa ating Mahal na Mayor Jun-Andeng Ynares para sa Mass Anti-Rabies Vaccination Sa Barangay Sta.Cruz!\r\nNasa ibaba po ang Schedule ng ating Mass Vaccination para sa ating mga Fur Babies kasama ang City Veterinary sa pag ikot para bakunahan ang ating mga fur-babies kontra rabies. Narito po ang schedule sa mga natitirang araw ngayong buwan ng May 30 - 31, 2023 hangang June 1 - July 27, 2023!', 'News_20230531021849.jpg', 'Anti Rabbies', '2023-05-30', '10:00:00', '1 week', 'Oscar Sese', 'Sta. Cruz Admin', 'Sitio Igiban', '2023-05-27 09:20:33', '2023-05-31 08:18:49', '1');
INSERT INTO `news_events` VALUES ('12', 'Serbisyong Barangay Sta. Cruz Sa Sitio Igiban', 'Ang inyong Lingkod Kap.Cirilo \"Bebot\"Tenorio at ang Sangguniang Barangay kasama ang ating Sangguniang Kabataan at Sta. Cruz Youth Federation ay taos pusong Nagpapasalamat sa mainit na pagtangap sa Serbisyong Barangay Sta.Cruz sa Sitio Igiban. \r\nMaraming Salamat po sa The Fraternal Order of Eagles (Central Luzon Region XLIII, Kaagapay Supreme Octa Eagles Club (Octa Cares) at Sa Our Lady of Fatima University, Antipolo City, College of Pharmacy. \r\nPara sa ibang mga sitio wag po kayo mag-aalala kami po ay iikot upang ilapit ang Serbisyo ng Ating Barangay sa bawat kabarangay po natin sa Barangay Sta. Cruz.', 'News_20230531013753.jpg', 'Programs', '2023-04-29', '08:00:00', 'One day', 'Oscar Sese', 'Sta. Cruz Admin', 'Sitio Igiban', '2023-05-31 07:37:53', '2023-05-31 07:37:53', '1');
INSERT INTO `news_events` VALUES ('13', 'Mobile Kitchen', 'Menu : Ginataang Puso ng Saging', 'News_20230531014457.jpg', 'Feeding program', '2019-11-29', '08:00:00', '2nd day', 'Oscar Sese', 'Sta. Cruz Admin', 'Sitio Igiban', '2023-05-31 07:44:57', '2023-05-31 07:44:57', '1');
